import React from "react";
import { useDispatch } from "react-redux";
import keys, { keysAction } from "../../store/keys";

import classes from "./KeyInput.module.css";

const KeyInput = () => {
  const dispatch = useDispatch();
  const addKeyHandler = () => {
    dispatch(keysAction.addKey);
  };

  return (
    <div className={classes.add__keys}>
      <input type="text" placeholder="Add keys" />
    </div>
  );
};

export default KeyInput;
